import Header from "./Header";

const layoutStyle = {
  maxWidth: "1280px",
  margin: "auto",
};

const Layout = (props) => (
  <div style={layoutStyle} className='margin-auto bg-gray-200'>
    <Header />
    {props.children}
  </div>
);

export default Layout;
